//export nvmlDeviceGetCudaComputeCapability
func nvmlDeviceGetCudaComputeCapability(nvmlDevice unsafe.Pointer, major unsafe.Pointer, minor unsafe.Pointer) C.nvmlReturn_t {
	if major == nil || minor == nil {
		return C.NVML_ERROR_INVALID_ARGUMENT
	}
	dev := engine.GetEngine().LookupDevice(uintptr(nvmlDevice))
	if dev == nil {
		return C.NVML_ERROR_INVALID_ARGUMENT
	}
	maj, min, ret := dev.GetCudaComputeCapability()
	if ret == nvml.SUCCESS {
		*(*C.int)(major) = C.int(maj)
		*(*C.int)(minor) = C.int(min)
	}
	return toReturn(ret)
}

